  input: '"TEXT","F3XA","C00014498","All expenditures made by the committee during
    this period are generic.  The committee hereby incorporates by reference Form
    F99 Miscellaneous Report, an April 22,2002 electronic filing that outlines the
    policies followed by the party in its effort to obtain the full name, address,
    occupation and employer for each contributor.  The Committee hereby incorporates
    by reference Form F99 Miscellaneous Report, a May 31, 2003 electronic filing that
    clarifies the partys policy relating to payments received from candidates for
    goods and services provided by the party to said candidates.   During the period
    covered by this report, wages and related payroll taxes and fringe benefits for
    any committee employee who spent 25 percent or more of his or her time on activities
    related to a Federal election are included on line 30(b). The committee also hereby
    incorporates by reference Form F99 Miscellaneous Report a July 27, 2005 electronic
    filing (FEC-182378) and Form F99 Miscellaneous Report a July 27, 2005 electronic
    filing (FEC-182379)containing our responses to the FECs preliminary review of
    this report dated June 29, 2005."'
